import pandas as pd
import numpy as np
import matplotlib.pyplot as plt

url = "https://raw.githubusercontent.com/terrablader11/tns-collab/main/alzheimer.csv"
data = pd.read_csv(url)
data.head()

data.describe()

"""We've loaded the dataset. We can see that this is a classification problem with the target variable of "Group". The rest is numerical data that can be used as features. Furthermore it seems that this is a three-stage classification problem.

# Preprocessing

The most pressing issue is the existence of NaN values within the dataset. There are a few approaches we can take to correct this:

1. Get rid of those features. This is by far the easiest way to correct the issue, and will not severly limit the information contained within the data as only two columns have NaN values (SES and MMSE).

2. Similarly, we can also remove samples with any NaN values. This is slightly harder and may eliminate information from the data, however it is roughly similar to 1. 

3. Replace these values with the mean or mode. This helps retain information, but may not be the most accurate to describe all datasets.

We'll use the first method here, but we encourage you to try the rest!
"""

x = pd.concat([data.iloc[:, 1:4], data.iloc[:, 6:]], axis=1)
y = data.iloc[:, 0]
x, y

"""The other issue we have is that one of our features, "M/F", is not numerical data. We can correct the issue with Sci-Kit Learn's OneHotEncoder.![one hot.png](data:image/png;base64,)"""

from sklearn.preprocessing import OneHotEncoder

encoding_data = x.iloc[:, 0]
encoding_data = encoding_data.values.reshape(-1, 1)
encoder = OneHotEncoder(handle_unknown='ignore')
encoder.fit(encoding_data)
encoder.categories_

"""Now that we've fit the encoder to the data, we can transform it and then add it back to the x variable. """

encoding_data = encoder.transform(encoding_data)
encoding_data.toarray()
encoding_data = pd.DataFrame(encoding_data.toarray())
encoding_data

x = pd.concat([encoding_data, x.iloc[:, 1:]], axis=1)
x.rename(columns = {0:'Female', 1:'Male'}, inplace = True)
x

"""# Creating a Model
![supervised.png](data:image/png;base64,)
"""

from sklearn.model_selection import train_test_split

X_train, X_test, y_train, y_test = train_test_split(x, y, test_size=0.3)
X_train, X_test, y_train, y_test

from sklearn.neighbors import KNeighborsClassifier
from sklearn.svm import SVC
from sklearn.tree import DecisionTreeClassifier
from sklearn.ensemble import RandomForestClassifier
from sklearn.metrics import plot_confusion_matrix
from sklearn.metrics import ConfusionMatrixDisplay

classifiers = [
    KNeighborsClassifier(),
    SVC(),
    DecisionTreeClassifier(),
    RandomForestClassifier(),
]


for clf in classifiers:
  clf.fit(X_train, y_train)
  #print(clf, "Accuracy:", clf.score(X_test, y_test))
  y_pred = clf.predict(X_test)
  ConfusionMatrixDisplay.from_predictions(y_test, y_pred)
  title = str(clf) + " Accuracy: " + str(round(clf.score(X_test, y_test), 4))
  plt.title(title)
  plt.show()